import React, { Component } from 'react'
import { MDBContainer, MDBRow } from 'mdbreact'

export default class sectionCards extends Component {
    render() {
        return (
            <div>
                <MDBContainer>
                    <MDBRow>
                        <h1>hello</h1>
                    </MDBRow>
                </MDBContainer>
            </div>
        )
    }
}
